import React from "react";
import Item from "./Items";

export default function List({
  blocktext,
  id,
}) {
  return (
    <div className="container">
      {blocktext.map((v, i) => (
        console.log(v, i),
        <div>
          <Item text={v[0]} />
          <button class="end">
            + Add a card
          </button>
        </div>         
      ))}
    </div>
  );
}
